            <div>
                <h1>Students List</h1>
             <option value=""> <section>
                    <input type="number" placeholder='Id' />
                    <input type="text" placeholder='Name' />

                 </section></option>


                {data.map((value) => {
                    return (<h1>
                        {value.id}-{value.name}

                    </h1>)
                })}
            </div>
        )
    }
}
